import React from "react";

const Home = () => {
  return (
    <div className="w-screen h-[calc(100%-70px)] absolute top-[70px] bg-red flex justify-center">
      <div className="w-[60%] h-full top-[70px]  items-center flex justify-center grid grid-cols-2">
        <div className="h-full w-full bg-dark"></div>

        <div className="h-full w-full bg-yellow"></div>
      </div>
    </div>
  );
};

export default Home;
